        <Fragment>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static" sx={{backgroundColor: 'rgb(16,17,25)'}} >
                    {/* Possibly change to image of logo instead */}
                    <Typography
                        variant="h6"
                        noWrap
                        align='left'
                        color="rgb("
                        sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
                    >
                        MealsFromDirt
                    </Typography>  

                </AppBar>

            </Box>


            <Box>
                Image
            </Box>
            <Box>
                Text Bar Input
            </Box>
            <Box>
                Enter Button
            </Box>
        </Fragment>
    )
}

